OpenResty IM 一个运行在OpenResty上的基于lor编写的web聊天软件。
完全基于OpenResty 存储采用MySQL，ngx.shared.DICT(共享内存区块) 方案: 服务端接收消息后 临时存储，客户端携带偏移位置一直读取最新。 安装 首先安装OpenResty(可以按自己的需要安装) [root@iZ~]#yum install libtermcap-devel ncurses-devel libevent-devel \ readline-devel pcre-devel openssl openssl-devel [root@iZ~]#wget https://openresty.org/download/openresty-1.11.2.3.tar.gz [root@iZ~]#tar xvf openresty-1.11.2.3.tar.gz [root@iZ~]#cd openresty-1.11.2.3 ./configure --with-luajit &amp;&amp; make &amp;&amp; make install 注意: 有个 resty-uuid 需要引用 libuuid.so 动态库 打印log提示信息是这样的: libuuid.so: cannot open shared object file: No such file or directory 解决方法: [root@iZ~]#yum install libuuid libuuid-devel [root@iZ~]#ln -s /lib64/libuuid.so.1.3.0 /usr/lib64/libuuid.so [root@iZ~]#ln -s /usr/lib64/libuuid.so /usr/local/openresty/lualib/resty/libuuid.so [root@iZ~]# ldconfig [root@iZ~]#yum install ImageMagick ImageMagick-devel # imagemagick c 库 [root@iZ~]#yum install GraphicsMagick-devel # GraphicsMagick c 库 目前只需要一张表用户表，将其导入到MySQL (按需处理多余字段) CREATE TABLE `mg_user_member` ( `uid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT &#39;用户UID&#39;, `admin_id` int(10) NOT NULL DEFAULT &#39;0&#39; COMMENT &#39;0为非管理员，1为管理员&#39;, `group_id` tinyint(1) NOT NULL DEFAULT &#39;1&#39; COMMENT &#39;类型 1-普通 2-客服 3-管理&#39;, `nickname` varchar(30) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;昵称&#39;, `mobile` varchar(15) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;手机号码&#39;, `email` varchar(75) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;邮箱&#39;, `password` varchar(256) NOT NULL COMMENT &#39;密码&#39;, `passkey` varchar(16) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;密码key&#39;, `regtime` int(10) unsigned NOT NULL DEFAULT &#39;0&#39; COMMENT &#39;注册时间&#39;, `regip` varchar(20) DEFAULT &#39;0&#39; COMMENT &#39;注册IP&#39;, `logintime` int(10) unsigned NOT NULL DEFAULT &#39;0&#39; COMMENT &#39;注册时间&#39;, `loginip` bigint(20) DEFAULT &#39;0&#39; COMMENT &#39;注册IP&#39;, `face` varchar(200) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;头像&#39;, `hide` tinyint(1) NOT NULL DEFAULT &#39;0&#39; COMMENT &#39;是否隐藏信息 1-是　0-否&#39;, `sex` tinyint(1) NOT NULL DEFAULT &#39;1&#39; COMMENT &#39;性别 1-男 0-女&#39;, `province` varchar(30) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;省份&#39;, `city` varchar(30) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;城市&#39;, `signature` varchar(255) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;签名&#39;, `lasttime` int(10) NOT NULL DEFAULT &#39;0&#39; COMMENT &#39;最后发言时间&#39;, `qq` varchar(20) NOT NULL DEFAULT &#39;&#39; COMMENT &#39;QQ号码&#39;, `iskick` tinyint(1) NOT NULL DEFAULT &#39;0&#39; COMMENT &#39;是否已被踢 1-是 0-否&#39;, `visible` tinyint(1) NOT NULL DEFAULT &#39;1&#39; COMMENT &#39;状态 1-显示 0-删除&#39;, `remark` varchar(255) DEFAULT NULL, `realname` varchar(30) DEFAULT &#39;&#39; COMMENT &#39;真实姓名&#39;, PRIMARY KEY (`uid`), KEY `regtime` (`regtime`), KEY `g` (`state`,`hide`,`lv`), KEY `mobile` (`mobile`) USING BTREE ) ENGINE=MyISAM AUTO_INCREMENT=1225 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT=&#39;用户表&#39;; 修改配置文件app/config/config.lua为本地对应配置，强烈建议将以下值修改为不同配置
session_secret 用于session加密 (暂时不用) pwd_secret 用户数据库密码存储时加密 mysql 配置 配置静态文件目录，这个目录用于存放用户上传的头像、聊天图片等
默认的目录为 /data/cluster/web/src/html/openresty/im/app/static/，如非必要建议目录和我一致，并保证有写权限 若要修改上述默认目录，请修改app/config/config.lua中的upload_config.dir和nginx配置文件中的$static_files_path的值，保证两个值一致 为了省事,建议项目直接解压在 /data/cluster/web/src/html/openresty/ 目录下
cd /data/web/openresty-im/proto protoc -o logic-goim.pb logic-goim.proto
CREATE TABLE mg_user ( id int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT &lsquo;用户UID&rsquo;, nickname varchar(30) NOT NULL DEFAULT &rsquo;&rsquo; COMMENT &lsquo;昵称&rsquo;, mobile varchar(15) NOT NULL DEFAULT &rsquo;&rsquo; COMMENT &lsquo;手机号码&rsquo;, password varchar(256) NOT NULL COMMENT &lsquo;密码&rsquo;, user_id bigint(11) NOT NULL COMMENT &lsquo;user_id&rsquo;, regtime int(10) unsigned NOT NULL DEFAULT &lsquo;0&rsquo; COMMENT &lsquo;注册时间&rsquo;, regip varchar(20) NOT NULL DEFAULT &lsquo;0&rsquo; COMMENT &lsquo;注册IP&rsquo;, logintime int(10) unsigned NOT NULL DEFAULT &lsquo;0&rsquo; COMMENT &lsquo;注册时间&rsquo;, loginip bigint(20) NOT NULL DEFAULT &lsquo;0&rsquo; COMMENT &lsquo;注册IP&rsquo;, face varchar(200) NOT NULL DEFAULT &lsquo;/static/wap/img/portrait.jpg&rsquo; COMMENT &lsquo;头像&rsquo;, sex tinyint(1) NOT NULL DEFAULT &lsquo;1&rsquo; COMMENT &lsquo;性别 1-男 0-女&rsquo;, visible tinyint(1) NOT NULL DEFAULT &lsquo;1&rsquo; COMMENT &lsquo;状态 1-显示 0-删除&rsquo;, remark varchar(255) NOT NULL DEFAULT &lsquo;&rsquo;, realname varchar(30) NOT NULL DEFAULT &rsquo;&rsquo; COMMENT &lsquo;真实姓名&rsquo;, PRIMARY KEY (id), UNIQUE KEY user_id (user_id), KEY mobile (mobile) ) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT=&lsquo;用户表&rsquo;;
CREATE TABLE mg_group ( id bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT &lsquo;群组id&rsquo;, group_id bigint(20) unsigned NOT NULL DEFAULT &lsquo;0&rsquo; COMMENT &lsquo;群组id&rsquo;, name varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT &lsquo;组名&rsquo;, dateline int(11) unsigned NOT NULL DEFAULT &lsquo;0&rsquo;, PRIMARY KEY (id) ) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=&lsquo;群组&rsquo;;
CREATE TABLE mg_group_user ( id bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT &lsquo;自增主键&rsquo;, group_id bigint(20) unsigned NOT NULL COMMENT &lsquo;组id&rsquo;, user_id bigint(20) unsigned NOT NULL COMMENT &lsquo;用户id&rsquo;, label varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT &lsquo;用户在群组的昵称&rsquo;, dateline int(11) unsigned NOT NULL DEFAULT &lsquo;0&rsquo;, PRIMARY KEY (id), UNIQUE KEY uk_group_user (group_id,user_id) USING BTREE, KEY idx_user_id (user_id) ) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT=&lsquo;群组成员关系&rsquo;;
